"Beer bread" recipe from @alexafuelednaturally . Hercules loves it. I  think Mom drinks with him every night haha

RECIPE
Ingredients:
3 cups all purpose gluten free flour (or bread flour) + 6 tsp xantham gum*
1 tbsp baking powder
4 tbsp cane sugar
1 (12 ounce) can of beer * my mistake of using IPA hahah too flavorful but its better light 
1/4 cup melted vegan butter 
1 tsp salt
.
I  added my SUPER MUSHROOM POWDER * @malamamushrooms I  PUT THIS IN EVERYTHING! I  LOVE THE UMAMI FLAVOR! 
.
DIRECTIONS
Preheat oven to 375 degrees & grease your loaf on with vegan butter!
Sift then Mix dry ingredients and beer until you get a dough ball.
Pour into a greased loaf pan.
Pour melted butter over top of the dough.
Bake 50 minutes.
.
